import { useEffect } from "react";

function PhoneDetails(){
    const [data, setData] = useState();
    useEffect(() => {
        axios
          .get("http://localhost:5005/api/phones/:id")
          .then((response) => {
            setData(response.data);
            console.log(response.data);
          })
          .catch((error) => {
            console.log("error: ", error);
          });
      }, []);
    return(
        <h1>phoneDetails</h1>
    )
}
